<style>
    body {
        margin: 0;
        padding: 0;
        font-family: "Times New Roman", serif;
        background-color: #f0f8ff;
    }
    .header {
        background-color: #6A0DAD;
        color: white;
        padding: 20px;
        text-align: center;
        box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
        position: relative;
        z-index: 9999;
    }
    .header h1 {
        margin: 0;
        font-size: 24px;
    }
    #map {
        height: calc(100vh - 70px);
        margin-top: 70px;
    }

    /* Position et style de la légende */
    .legend {
        position: absolute;
        bottom: 50px; left: 50px; width: 100px; height: auto;
        z-index: 1000; background-color: white;
        padding: 10px; border: 2px solid black; border-radius: 5px;
    }

    .legend h4 {
        margin:0;
        font-size:16px;
    }

    .legend-item {
        display:flex; align-items:center; margin-bottom:5px;
    }

    .legend-color {
        width:20px; height:20px; background:blue; margin-right:5px;
    }

    /* Boutons de zoom */
    .zoom-buttons {
        position: absolute;
        top: 100px; 
        right: 50px; 
        z-index: 1000; 
        background: white; 
        padding: 10px; 
        border-radius:5px; 
        border:2px solid black;
    }

    .zoom-buttons button {
        display: block;
        width: 100%;
        margin-bottom:5px;
        background:#6A0DAD; 
        color:white; 
        border:none; 
        padding:5px; 
        border-radius:3px;
        cursor:pointer;
    }

    .zoom-buttons button:hover {
        background:#5a0ca0;
    }
</style>
<div class="header">
    <h1>Visualisation du GeoParquet</h1>
</div>

<!-- Légende -->
<div class="legend">
    <h4>Légende</h4>
    <ul style="list-style-type:none; padding-left:0; margin:0;">
        <li class="legend-item">
            <div class="legend-color"></div>
            <span>Bâtiment</span>
        </li>
    </ul>
</div>

<!-- Boutons de zoom -->
<div class="zoom-buttons">
    <button onclick="zoomToZone1()">Zone 1</button>
    <button onclick="zoomToZone2()">Zone 2</button>
</div>

<script>
    // Fonction pour zoomer sur la zone 1 (Marrakech)
    function zoomToZone1() {
        // Coordonées Marrakech : 31.643579, -8.015993, zoom 14
        window.myMap.setView([31.643579, -8.015993], 14);
    }

    // Fonction pour zoomer sur la zone 2
    function zoomToZone2() {
        // Coordonnées Zone 2 : 31.0808, -8.6537, zoom 12
        window.myMap.setView([31.0808, -8.6537], 12);
    }
</script>
    
<script>
document.addEventListener('DOMContentLoaded', function(){
    // On récupère l'objet carte folium dans le JS
    var mapVarName = Object.keys(window).find(k => k.startsWith('map_'));
    window.myMap = window[mapVarName];
});
</script>
